import React from 'react'

const Users = (props) =>{
    
    return(
        <div>
            {
                props.users.map(u => <div key={u.id}>

                <div>
                    <div>
                        <img src="" alt=""/>
                    </div>
                    <div>
                        <button>follow</button>
                    </div>
                </div>

                </div>)
            }
        </div>
    )
}

export default Users;
